class Svg extends React.Component {
	shouldComponentUpdate(nextProps) {
		if (this.props.src !== nextProps.src) {
			return true
		} else {
			return false
		}
	}
	render() {
		return <ReactSVG {...this.props} />
	}
}

export default Svg
